import React, { Component } from 'react';
import MetaTags from 'react-meta-tags';
import { Container, Row, Col } from 'react-bootstrap';

export default class Poslovnice extends Component {
	render() {
		return (
			<React.Fragment>
				<Container>
					<Row>
						<Col className="mt-5">
							<h2 className="mt-5">
								Stranica u izradi
							</h2>
						</Col>
					</Row>
				</Container>
			</React.Fragment>
		);
	}
}
